import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import Card from "@material-ui/core/Card";
import CardContent from "@material-ui/core/CardContent";
import CardMedia from "@material-ui/core/CardMedia";
import Typography from "@material-ui/core/Typography";
import Chip from "@material-ui/core/Chip";
import FavoriteIcon from "@material-ui/icons/Favorite";
import Grid from "@material-ui/core/Grid";
import Box from "@material-ui/core/Box";
import docImg from "../../img/results/docAlex.png";

const useStyles = makeStyles((theme) => ({
  root: {
    display: "flex",
    margin: 30,
  },
  details: {
    display: "flex",
    flexDirection: "row",
  },
  img: {
    width: "60%",
    marginLeft: 30,
    marginRight: 30,
  },

  imageGrid: {
    display: "flex",
    flexDirection: "row",
    justifyContent: "center",
    alignItems: "center",
  },
}));

//This card is imported in SearchResult.js

// Each indiivdual doctor card
export default function DocCard() {
  const classes = useStyles();

  return (
    <Card className={classes.root}>
      <div className={classes.details}>
        <Grid container spacing={0}>
          <Grid item md={3} className={classes.imageGrid}>
            {/* doctor image */}
            <CardMedia
              component="img"
              className={classes.cover}
              image={docImg}
            ></CardMedia>
          </Grid>
          <Grid item md={7}>
            <CardContent>
              {/* doctor details */}
              <Typography variant="h6" color="primary">
                Dr. Alex Leow
              </Typography>
              <br></br>
              <Typography variant="subtitle1" color="textSecondary">
                Specialty: <span>Gastroenterology</span>
              </Typography>
              <Typography variant="subtitle1" color="textSecondary">
                Hospital: <span>Pantai Hospital Kuala Lumpur</span>
              </Typography>
              <Typography variant="subtitle1" color="textSecondary">
                Languages: <span>English, Malay, Mandarin, Cantonese</span>
              </Typography>
              <br></br>
              {/* private tag */}
              <Chip color="secondary" size="small" label="Private"></Chip>
            </CardContent>
          </Grid>
          <Grid item md={2}>
            {/* Like icon + number of likes */}
            <Box
              mt={3}
              mr={1}
              display="flex"
              flexDirection="column"
              justifyContent="center"
              alignItems="center"
            >
              <FavoriteIcon color="secondary" />
              <Typography variant="body2" color="primary">
                100
              </Typography>
            </Box>
          </Grid>
        </Grid>
      </div>
    </Card>
  );
}
